package net.linxingyang.diary.qo;import java.util.Date;import java.util.Set;import net.linxingyang.diary.pojo.Bill;public class BillQo extends Bill{    private Integer page;    private Integer limit;    private String orderBy;        private Date minBillDate;    private Date maxBillDate;        private Set<Integer> configIds;    private Integer configIdsLength = Integer.valueOf(0);        public Set<Integer> getConfigIds() {		return configIds;	}	public void setConfigIds(Set<Integer> configIds) {		this.configIds = configIds;	}	public Integer getConfigIdsLength() {		return configIdsLength;	}	public void setConfigIdsLength(Integer configIdsLength) {		this.configIdsLength = configIdsLength;	}	public Date getMinBillDate() {		return minBillDate;	}	public void setMinBillDate(Date minBillDate) {		this.minBillDate = minBillDate;	}	public Date getMaxBillDate() {		return maxBillDate;	}	public void setMaxBillDate(Date maxBillDate) {		this.maxBillDate = maxBillDate;	}	public String getOrderBy() {        return orderBy;    }    public void setOrderBy(String orderBy) {        this.orderBy = orderBy;    }    public void setPage(Integer page) {        this.page = page;    }         public Integer getPage() {        return this.page;    }        public void setLimit(Integer limit) {        this.limit = limit;    }        public Integer getLimit() {        return this.limit;        }    }